#!/data/data/com.termux/files/usr/bin/bash

set -e

mkdir -p "$HOME/.termux"

cat > "$HOME/.termux/colors.properties" << 'EOF'
# https://github.com/catppuccin/catppuccin
foreground=#cdd6f4
background=#1e1e2e
cursor=#f5e0dc

color0=#45475a
color1=#f38ba8
color2=#a6e3a1
color3=#f9e2af
color4=#89b4fa
color5=#f5c2e7
color6=#94e2d5
color7=#bac2de

color8=#585b70
color9=#f38ba8
color10=#a6e3a1
color11=#f9e2af
color12=#89b4fa
color13=#f5c2e7
color14=#94e2d5
color15=#a6adc8

color16=#fab387
color17=#f5e0dc
EOF

cat > "$HOME/.termux/termux.properties" << 'EOF'
extra-keys = [ \
    [ \
        "ESC", \
        "DRAWER", \
        "KEYBOARD", \
        { \
            "macro": "CTRL c", \
            "display": "^C" \
        }, \
        { \
            "key": "$", \
            "display": "$^", \
            "popup": { \
                "key": "^" \
            } \
        }, \
        { \
            "key": ":", \
            "display": ":;", \
            "popup": { \
                "key": ";" \
            } \
        }, \
        { \
            "macro": "QUOTE QUOTE LEFT", \
            "display": "\\\" '", \
            "popup": { \
                "macro": "'' LEFT", \
                "display": "'" \
            } \
        }, \
        { \
            "key": ">", \
            "display": "><", \
            "popup": { \
                "key": "<" \
            } \
        }, \
        "PGUP" \
    ], \
    [ \
        { \
            "key": "TAB", \
            "display": "TAB" \
        }, \
        { \
            "key": "|", \
            "display": "| \\\\", \
            "popup": { \
                "key": "\\\\" \
            } \
        }, \
        { \
            "key": "&", \
            "display": "&*", \
            "popup": { \
                "key": "*" \
            } \
        }, \
        { \
            "key": "/", \
            "display": "/ ?", \
            "popup": { \
                "key": "?" \
            } \
        }, \
        { \
            "macro": "() LEFT", \
            "display": "()" \
        }, \
        "HOME", \
        "UP", \
        "END", \
        "PGDN" \
    ], \
    [ \
        "CTRL", \
        "ALT", \
        { \
            "key": "=", \
            "display": "=+", \
            "popup": { \
                "key": "+" \
            } \
        }, \
        { \
            "key": "-", \
            "display": "-_", \
            "popup": { \
                "key": "_" \
            } \
        }, \
        { \
            "macro": "[] LEFT", \
            "display": "[{", \
            "popup": { \
                "macro": "{} LEFT", \
                "display": "{}" \
            } \
        }, \
        "LEFT", \
        "DOWN", \
        "RIGHT", \
        "ENTER" \
    ] \
]
EOF

base64 -d << 'EOF' | xz -d > "$HOME/.termux/font.ttf"

EOF

termux-reload-settings

ln -sf "$PREFIX/etc/termux/mirrors/chinese_mainland" "$PREFIX/etc/termux/chosen_mirrors"

pkg update && pkg upgrade -y
